enum BitDomain<'a, M = Const, T = usize, O = Lsb0> where M: Mutability,
    T: 'a + BitStore, O: BitOrder, Address<M, BitSlice<T, O>>: Referential,
    Address<M, BitSlice<T::Unalias, O>>: Referential {
    Enclave(Reference),
    Region {
            head: Reference,
            body: Reference,
            tail: Reference,
        },
}

enum Domain<'a, M = Const, T = usize, O = Lsb0> where M: Mutability, T: 'a +
    BitStore, O: BitOrder, Address<M, T>: Referential,
    Address<M, [T::Unalias]>: SliceReferential {
    Enclave(PartialElement),
    Region {
            head: Option<PartialElement>,
            body: Reference,
            tail: Option<PartialElement>,
        },
}

enum BitPtrError<T> where T: BitStore {
    Null(NullPtrError),
    Misaligned(MisalignError<T>),
}

enum BitSpanError<T> where T: BitStore {
    Null(NullPtrError),
    Misaligned(MisalignError<T>),
    TooLong(usize),
    TooHigh(*const T),
}

fn for_each<impl FnMut(usize, bool) -> bool>(&mut Self,
impl FnMut(usize, bool) -> bool) where
impl FnMut(usize, bool) -> bool: FnMut(usize, bool) -> bool

fn try_view_bits<O>(&Self)
-> Result<&BitSlice<Self::Store, O>, BitSpanError<Self::Store>> where
O: BitOrder

fn try_view_bits_mut<O>(&mut Self)
-> Result<&mut BitSlice<Self::Store, O>, BitSpanError<Self::Store>> where
O: BitOrder
